import React from 'react';
import { Route, Switch } from 'react-router-dom';  // Use { Routes, Route } for v6
import "./App.css"
import Navbar from './Components/Navbar';
import Home from './Components/Home'; // Replace with the correct path
import About from './Components/About'; // Replace with the correct path

function App() {
  return (
    <>
      <Navbar />
      <Switch> 
        <Route exact path='/' component={Home} />  // Use element={<Home />} 
        <Route path='/hero' component={About} />  // Use element={<About />} for
      </Switch>  
    </>
  )
}

export default App;
